```solidity
pragma solidity ^0.8.0;

contract SupportChoreography {
    enum TokenState {
        Start,
        ClientHasProblem,
        ProblemDescriptionReceived,
        OperatorKnowsSolution,
        SolutionProvided,
        ClientAsksLevel1,
        Level1ProvidesSolution,
        Level1DoesNotKnowSolution,
        Level1AsksLevel2,
        Level2ProvidesSolution,
        Level2DoesNotKnowSolution,
        End
    }

    TokenState public tokenstate;
    address public client;
    address public operator;
    address public level1;
    address public level2;

    event TaskEnacted(uint taskID, TokenState previousState, TokenState newState);

    constructor(address _client, address _operator, address _level1, address _level2) {
        client = _client;
        operator = _operator;
        level1 = _level1;
        level2 = _level2;
        tokenstate = TokenState.Start;
    }

    function enact(uint taskID) external {
        require(msg.sender == client || msg.sender == operator || msg.sender == level1 || msg.sender == level2, "Only participants can enact tasks");

        if (tokenstate == TokenState.Start && taskID == 1) {
            tokenstate = TokenState.ClientHasProblem;
            emit TaskEnacted(taskID, TokenState.Start, TokenState.ClientHasProblem);
        } else if (tokenstate == TokenState.ClientHasProblem && taskID == 2) {
            tokenstate = TokenState.ProblemDescriptionReceived;
            emit TaskEnacted(taskID, TokenState.ClientHasProblem, TokenState.ProblemDescriptionReceived);
        } else if (tokenstate == TokenState.ProblemDescriptionReceived && taskID == 3) {
            tokenstate = TokenState.OperatorKnowsSolution;
            emit TaskEnacted(taskID, TokenState.ProblemDescriptionReceived, TokenState.OperatorKnowsSolution);
        } else if (tokenstate == TokenState.OperatorKnowsSolution && taskID == 4) {
            tokenstate = TokenState.SolutionProvided;
            emit TaskEnacted(taskID, TokenState.OperatorKnowsSolution, TokenState.SolutionProvided);
        } else if (tokenstate == TokenState.ProblemDescriptionReceived && taskID == 5) {
            tokenstate = TokenState.ClientAsksLevel1;
            emit TaskEnacted(taskID, TokenState.ProblemDescriptionReceived, TokenState.ClientAsksLevel1);
        } else if (tokenstate == TokenState.ClientAsksLevel1 && taskID == 6) {
            tokenstate = TokenState.Level1ProvidesSolution;
            emit TaskEnacted(taskID, TokenState.ClientAsksLevel1, TokenState.Level1ProvidesSolution);
        } else if (tokenstate == TokenState.ClientAsksLevel1 && taskID == 7) {
            tokenstate = TokenState.Level1DoesNotKnowSolution;
            emit TaskEnacted(taskID, TokenState.ClientAsksLevel1, TokenState.Level1DoesNotKnowSolution);
        } else if (tokenstate == TokenState.Level1DoesNotKnowSolution && taskID == 8) {
            tokenstate = TokenState.Level1AsksLevel2;
            emit TaskEnacted(taskID, TokenState.Level1DoesNotKnowSolution, TokenState.Level1AsksLevel2);
        } else if (tokenstate == TokenState.Level1AsksLevel2 && taskID == 9) {
            tokenstate = TokenState.Level2ProvidesSolution;
            emit TaskEnacted(taskID, TokenState.Level1AsksLevel2, TokenState.Level2ProvidesSolution);
        } else if (tokenstate == TokenState.Level1AsksLevel2 && taskID == 10) {
            tokenstate = TokenState.Level2DoesNotKnowSolution;
            emit TaskEnacted(taskID, TokenState.Level1AsksLevel2, TokenState.Level2DoesNotKnowSolution);
        } else if (tokenstate == TokenState.SolutionProvided && taskID == 11) {
            tokenstate = TokenState.End;
            emit TaskEnacted(taskID, TokenState.SolutionProvided, TokenState.End);
        } else if (tokenstate == TokenState.Level2ProvidesSolution && taskID == 11) {
            tokenstate = TokenState.End;
            emit TaskEnacted(taskID, TokenState.Level2ProvidesSolution, TokenState.End);
        } else {
            revert("Invalid taskID or state transition");
        }
    }
}
